(function () {
    function responsive() {
        var banner = new Swiper('.banner-container .swiper-container', {
            loop: true,
            autoplay: true,
            slideToClickedSlide: true,
            pagination: {
                el: '.swiper-pagination',
                clickable: true
            },
            navigation: {
                nextEl: '.swiper-button-next',
                prevEl: '.swiper-button-prev'
            }
        });

        $(".banner-container .swiper-container").hover(function () {
            banner.autoplay.stop();
        }, function () {
            banner.autoplay.start();
        });

        var adv = new Swiper('.adv .swiper-container', {
            loop: true,
            autoplay: true,
            slideToClickedSlide: true,
            pagination: {
                el: '.swiper-pagination',
                clickable: true
            },
            navigation: {
                nextEl: '.swiper-button-next',
                prevEl: '.swiper-button-prev'
            }
        });

        $(".adv .swiper-container").hover(function () {
            adv.autoplay.stop();
        }, function () {
            adv.autoplay.start();
        });

        var product = new Swiper('.product-banner .swiper-container', {
            loop: true,
            autoplay: true,
            slideToClickedSlide: true,
            pagination: {
                el: '.swiper-pagination',
                clickable: true
            },
            navigation: {
                nextEl: '.swiper-button-next',
                prevEl: '.swiper-button-prev'
            }
        });

        $(".product-banner .swiper-container").hover(function () {
            product.autoplay.stop();
        }, function () {
            product.autoplay.start();
        });
    };
    responsive();
    // window.addEventListener("onorientationchange" in window ? "orientationchange" : "resize", responsive, false);
})();

(function () {

    var url = window.location.href;

    // Search
    $(".search-btn").on("click", function () {
        $(this).parents("form").submit();
    });

    // Message Form
    $("#message").on("submit", function (e) {
        var rg =
            /^(((13[0-9]{1})|(14[0-9]{1})|(17[0]{1})|(15[0-3]{1})|(15[5-9]{1})|(18[0-9]{1}))+\d{8})$/;
        var tel = $("input[name=tel]").val();
        if (!rg.test(tel)) {
            e.preventDefault();
            alert("请输入正确的手机号码");
        };
        $(this).find("input[name=company]").val(url);
    });

    // Header
    $("header .phone span").on("click", function () {
        if ($(this).hasClass("active")) {
            $("header .mask .back").click();
        } else {
            $(this).addClass("active");
            $("header .mask").addClass("active");
        };
    });

    $("header .mask .back").on("click", function () {
        $(this).parents(".mask").removeClass("active");
        $("header .phone span").removeClass("active");
    });

    // Footer
    $("footer .phone a").on("click", function () {
        if ($(this).hasClass("active")) {
            $(this).removeClass("active");
            $("footer .mask").fadeOut();
            $("footer .mask div").eq($(this).index()).removeClass("active");
        } else {
            $(this).siblings().removeClass("active");
            $(this).addClass("active");
            $("footer .mask").fadeIn();
            $("footer .mask div").eq($(this).index()).siblings().removeClass("active");
            (function (n) {
                $("footer .mask div").eq(n).addClass("active");
            })($(this).index());
        };
    });

    $("footer .mask").on("click", function () {
        $(this).fadeOut();
        $("footer .phone a").removeClass("active");
        $("footer .mask div").removeClass("active");
    });

    $("footer .mask div").on("click", function (e) {
        e.stopPropagation();
    });
})();

(function () {
    $(".button span.service").on("click", contact);
    $(".button span.telephone").on("click", function () {
        var telephone = $(this).attr("data-telephone");
        responsive();
        // window.addEventListener("onorientationchange" in window ? "orientationchange" : "resize", responsive, false);
        function responsive() {
            if (isPhone()) {
                window.open("tel:" + telephone, "_blank");
            } else {
                window.alert(telephone);
            }
        };
    });
})();

function isPhone() {
    return ((/iphone|ipod|android|mobile|blackberry|webos|incognito|webmate|bada|nokia|lg|ucweb|skyfire/i).test(window.navigator.userAgent)) ? (true) : (false);
};

function contact() {
    var w = $(window).width();
    var h = $(window).height();
    var x = (w > 768) ? (w * 0.7) : (w);
    var y = (w > 768) ? (h * 0.7) : (h);
    var t = (w > 768) ? (h * 0.15) : (h);
    var l = (w > 768) ? (w * 0.15) : (h);
    var u = window.message || '';

    if ((/^http/i).test(u)) {
        window.open(u, "_blank", "toolbar=yes, location=yes, directories=no, status=no, menubar=yes, scrollbars=yes, resizable=no, copyhistory=yes, width=" + x + ", height=" + y + ", top=" + t + "px," + "left=" + l + "px");
    }
};